import React from "react";
import Olympics from "./Olympics";
import { Link } from "react-router-dom";
const Brand = (props) => {
  return (
    <>
      {props.brand.map((brand, idx) => (
        <Link to={`/blogs/${brand.id}`} className="links">
          <Olympics key={idx} brand={brand} />
        </Link>
      ))}
    </>
  );
};

export default Brand;
